import React from 'react';

interface TeamImageProps {
  name: string;
  style?: React.CSSProperties;
}

const TeamImage: React.FC<TeamImageProps> = ({ name, style = {} }) => {
  // Directly embed base64 image data for guaranteed compatibility
  if (name === "Mulualem Berhanu") {
    // Mulualem's image
    return (
      <img 
        src={`data:image/jpeg;base64,`}
        alt={name}
        className="w-full h-64 object-cover object-top"
        style={{
          objectPosition: "center 15%",
          ...style
        }}
      />
    );
  } else if (name === "Samrawit Kassa") {
    // Samrawit's image
    return (
      <img 
        src={`data:image/jpeg;base64,`}
        alt={name}
        className="w-full h-64 object-cover object-top"
        style={{
          objectPosition: "center 15%",
          ...style
        }}
      />
    );
  }
  
  // Default fallback image
  return (
    <img 
      src={`data:image/svg+xml;utf8,<svg xmlns="http://www.w3.org/2000/svg" width="200" height="200" viewBox="0 0 200 200"><rect width="200" height="200" fill="%23f0f0f0"/><text x="50%" y="50%" font-family="Arial" font-size="24" fill="%23999" text-anchor="middle" dominant-baseline="middle">${name}</text></svg>`}
      alt={name}
      className="w-full h-64 object-cover"
      style={style}
    />
  );
};

export default TeamImage;